#include <iostream>
#include <vector>
#include "array.h"
#include "input.h"

using namespace std;

class Solution
{
public:
    int subarraySum(vector<int> &nums, int k)
    {
        unordered_map<int, int> umap;
        int result = 0;
        int sum = 0;
        umap[sum] = 1;
        for (int i = 0; i < nums.size(); i++)
        {
            sum += nums[i];
            int diff = sum - k;
            if (umap.find(diff) != umap.end())
                result += umap[diff];

            umap[sum]++;
        }
        return result;
    }
};

